import React, { Component } from 'react'
import axios from 'axios'

class Navbar extends Component {
    render() {
        return(
            <div>
                <ul>
                    <li>Home</li>
                    <li>Blogs</li>
                    <li>Register</li>
                </ul>
            </div>
        )
    }
}

export default Navbar;
